import React, { Component } from "react";
import { Link } from "react-router-dom";


const Navigation = (props) => {
    const postSignOut = async () => {
        await props.doSignOut();
        if (!props.dataUser.is_login) {
            console.log("cek cek", this)
            props.history.replace("/");
        };
    };
    console.log("cek header", props)
    return (
        <div className="top-header mb-4">
            <header>
                <p className="mini-header-txt ml-5">Need help? <i className="fab fa-whatsapp"></i> 081289879972</p>
            </header>
            <nav className="navbar navbar-expand-lg navbar-light bg-light mt-4">
                <img className="logo" src={require("../assets/logo.jpg")} alt="logo" />
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
                <div className="collapse navbar-collapse" id="navbarSupportedContent">
                    <form className="form-inline my-2 my-lg-0">
                        <input className="form-control" type="search" placeholder="Search" aria-label="Search" />
                        {/* <button className="btn btn-outline-success my-2 my-sm-0" type="submit"><i className="fas fa-search"></i></button> */}
                    </form>
                    <div>
                        <ul className="navbar-nav mr-auto">
                            <li className="nav-item">
                                <Link className="nav-link" to="/">Home</Link>
                            </li>
                            <li className="nav-item">
                                {props.dataUser.is_login ? (
                                    <Link className="nav-link" to="/checkout"><i className="fas fa-shopping-cart"></i> Add to cart</Link>
                                ) : (
                                        <Link
                                            class="nav-item nav-link" to="/register">
                                        </Link>
                                    )}
                            </li>
                            <li className="nav-item">
                                {props.dataUser.is_login ? (
                                    <Link className="nav-link" to="/profile"><i className="fas fa-user-alt"></i> My Account</Link>
                                ) : (
                                        <Link
                                            class="nav-item nav-link" to="/login">
                                            Login
                                        </Link>
                                    )
                                }
                            </li>
                            <li className="nav-item">
                                {props.dataUser.is_login ? (
                                    <Link className="nav-link" to="/login">Sign Out</Link>
                                ) : (
                                        <div></div>
                                    )
                                }
                            </li>

                        </ul>

                    </div>
                </div>
            </nav>
        </div>
    )
};

export default Navigation;
